claim.claim-text:
14. A method of introducing a single locus conversion into a soybean plant, wherein the method comprises:
(a) crossing the CL1941882 plant of claim 1 with a plant of another soybean variety that comprises the single locus to produce F1 progeny plants;
(b) selecting one or more F1 progeny plants from step (a) to produce selected progeny plants;
(c) selfing selected progeny plants of step (b) or crossing the selected progeny plants of step (b) with the CL1941882 plants to produce later generation selected progeny plants;
(d) crossing or further selecting for later generation selected progeny plants that have the single locus and physiological and morphological characteristics of soybean variety CL1941882 to produce selected next later generation progeny plants; and optionally
(e) repeating crossing or selection of later generation progeny plants to produce progeny plants that comprise the single locus and all of the physiological and morphological characteristics of said single locus and of soybean variety CL1941882 when grown in the same location and in the same environment, wherein a representative sample of seed of said soybean variety CL1941882 has been deposited under NCMA Accession Number 202402004.
